import React from "react";

function Header() {
  const categories = [
    {
      name: "About", //this is the name of the link
      label: "About", //this is the label that will be displayed in the navbar
    },
    {
      name: "Projects",
      label: "Projects",
    },
    {
      name: "Contact",
      label: "Contact",
    },
    {
      name: "Resume",
      label: "Resume",
    },
  ];

  return (
    <header>
      <h2>
        <a href="/">
          <span role="img" aria-label="icon">
            üñ•Ô∏è
          </span>{" "}
          Jordan Hackworth
        </a>
      </h2>
      <nav>
        <ul className="flex-row">
          <li className="mx-2">
            <a href="#about">About me</a>
          </li>
          <li>
            <a href="#portfolio" className="mx-2">
              Portfolio
            </a>
          </li>
          <li>
            <a href="#resume" className="mx-2">
              Resume
            </a>
          </li>
          <li>
            <span className="mx-2">Contact</span>
          </li>
          {categories.map((category) => (
            <li className="mx-1" key={category.name}>
              <span>{category.name}</span>
            </li>
          ))}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
